import React, { Component } from 'react';

class Project extends Component {
    render() {
        return (
        <div className="App-body">
          <div className="Body-title">
            <p>일리소프트 교육 </p>
            <p>AR 콘텐츠를 통한 언플러그드 학습</p>
          </div>
          <div className="Body-content"> 
          </div>
        </div>
        )
    }
}

export default Project;
